  function pdf_tarifario_rack(Request $data) {
    $request = $data->json()->all();
    $html_content = '<pagina><div style="width:100%; height:350px;"></div><div style="width:100%; margin-left: 150px; margin-right:100px;">';
    $html_content .= '<p style="text-align:right;"><strong>##canton## , ##fecha##<br/><br/></strong></p><p style="text-align: justify">Conforme a lo determinado en la disposición general tercera del Reglamento General de Alojamiento "Los establecimientos de alojamiento deberán informar a la autoridad nacional de turismo hasta el primero de diciembre de cada año sobre las tarifas rack o mostrador del año siguiente. Estas considerarán el valor por huésped por noche por tipo de habitación y por temporada alta y baja, incluido impuesto; de no hacerlo la Autoridad Nacional de Turismo sancionar conforme a la normativa vigente", para el cumplimiento se procede a detallar a continuación, la siguiente información:</p>';
    $html_content .= '<table style="margin:auto; text-align: left; width:50%;">';
    $html_content .= '<tr><td colspan="2" style="text-align:center;"><strong>DATOS GENERALES<br /></strong></td></tr>';
    $html_content .= '<tr><th>NOMBRE COMERCIAL:</th><th style="border-bottom: 1px solid black;">##nombre_comercial##</th></tr>';
    $html_content .= '<tr><th>RUC:</th><th style="border-bottom: 1px solid black;">##ruc##</th></tr>';
    $html_content .= '<tr><th>PROPIETARIO:</th><th style="border-bottom: 1px solid black;">##propietario##</th></tr>';
    $html_content .= '<tr><th>REPRESENTANTE LEGAL:</th><th style="border-bottom: 1px solid black;">##representante_legal##</th></tr>';
    $html_content .= '<tr><th>DIRECCIÓN:</th><th style="border-bottom: 1px solid black;">##direccion##</th></tr>';
    $html_content .= '<tr><th>CANTON:</th><th style="border-bottom: 1px solid black;">##canton##</th></tr>';
    $html_content .= '<tr><th>CLASIFICACIÓN:</th><th style="border-bottom: 1px solid black;">##clasificacion##</th></tr>';
    $html_content .= '<tr><th>CATEGORÍA:</th><th style="border-bottom: 1px solid black;">##categoria##</th></tr>';
    $html_content .= '</table>';
    $html_content .= '<p style="text-align:left;">LISTADO DE TARIFAS:</p><p style="text-align:left;"><strong>*Precios incluyen IVA</strong><br /><br /></p>';
    $html_content .= '<table style="margin:auto; text-align: center; width:50%;">';
    $html_content .= '<tr><td style="border-bottom: 1px solid black;"></td></tr>';
    $html_content .= '<tr><td><strong>##nombre_coordinador_Zonal##</strong></td></tr>';
    $html_content .= '<tr><td><strong>Coordinación Zonal:##zonal##</strong></td></tr>';
    $html_content .= '</table>';
    $html_content .= '</div></pagina>';
    try {
      $qr = $request['qr'];
    } catch (Exception $e) {
      $qr = false;
    }
    try {
      $qr_content = $request['qr_content'];
    } catch (Exception $e) {
      $qr_content = '';
    }
    try {
      $params = $request['params'];
    } catch (Exception $e) {
      $params = [];
    }
    if (!$params) {
      $params = [];
    }
    $title = 'TARIFARIO RACK O MOSTRADOR';
    $pdf_content = $this->build_content($html_content, $params);
    $html = $this->mintur_style($pdf_content, $title, $qr, $qr_content);
    $orientation = 'portrait';
    $pdf = App::make('dompdf.wrapper');
    $pdf->setPaper('A4', $orientation);
    $pdf->setOptions(['dpi' => 150, 'defaultFont' => 'courier']);
    $pdf->loadHTML($html);
    $bytes = $pdf->output();
    $toReturn = base64_encode($bytes);
    return response()->json($toReturn, 200);
  }

  protected function buildPagesChecklist($requisites) {
    $toReturn = '';
    $paginas = 0;
    $requisitosImpresos = 0;
    $requisitesPerPage = 30;
    $pageContent = '<table style="width: 100%; border: 1px solid black; border-collapse: collapse; text-align: left;">';
    $pageContent .= '<tr><th style="border: 1px solid black;">Código</th><th style="border: 1px solid black;">Descripción</th><th style="border: 1px solid black;">Usuario</th><th style="border: 1px solid black;">Verificación</th></tr>';
    foreach ($requisites as $requisite) {
      if ($requisite['HTMLtype'] == 'GRUPO 0') {
        $pageContent .= '<tr style="background-color:yellow;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'GRUPO 1') {
        $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'GRUPO 2') {
        $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'GRUPO 3') {
        $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'GRUPO 4') {
        $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'GRUPO 5') {
        $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
      }
      if ($requisite['HTMLtype'] == 'TRUE / FALSE') {
        $cumple = "CUMPLE";
        if ($requisite['value'] == 'true') {
          $cumple = "CUMPLE";
        } else {
          $cumple = "NO CUMPLE";
        }
        $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $cumple . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
      }
      if ($requisite['HTMLtype'] == 'YES / NO') {
        $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $requisite['value'] . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
      }
      if ($requisite['HTMLtype'] == 'NUMBER') {
        $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $requisite['value'] . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
      }
      $requisitosImpresos++;
      if($requisitosImpresos % $requisitesPerPage == 0) {
        $paginas++;
        $pageContent .= '</table>';
        $toReturn .= '<pagina><div style="width:100%; height:200px;"></div><div style="width:100%; margin-left: 150px; margin-right:100px;">';
        $toReturn .= $pageContent;
        $toReturn .= '</div></pagina>';
        $pageContent = '<table style="width: 100%; border: 1px solid black; border-collapse: collapse; text-align: left;">';
        $pageContent .= '<tr><th style="border: 1px solid black;">Código</th><th style="border: 1px solid black;">Descripción</th><th style="border: 1px solid black;">Usuario</th><th style="border: 1px solid black;">Verificación</th></tr>';
      }
    }
    if ($paginas * $requisitesPerPage < sizeof($requisites)) {
      $currIndex = $paginas * $requisitesPerPage;
      $pageContent = '<table style="width: 100%; border: 1px solid black; border-collapse: collapse; text-align: left;">';
      $pageContent .= '<tr><th style="border: 1px solid black;">Código</th><th style="border: 1px solid black;">Descripción</th><th style="border: 1px solid black;">Usuario</th><th style="border: 1px solid black;">Verificación</th></tr>';
      for($i = $currIndex ; $i < sizeof($requisites) ; $i++) {
        $requisite = $requisites[$i];
        if ($requisite['HTMLtype'] == 'GRUPO 0') {
          $pageContent .= '<tr style="background-color:yellow;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'GRUPO 1') {
          $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'GRUPO 2') {
          $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'GRUPO 3') {
          $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'GRUPO 4') {
          $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'GRUPO 5') {
          $pageContent .= '<tr style="background-color:LightGray;"><td></td><th style="border: 1px solid black; font-size: 16px;" colspan="3">'. $requisite['requisite_name'] .'</th></tr>';
        }
        if ($requisite['HTMLtype'] == 'TRUE / FALSE') {
          $cumple = "CUMPLE";
          if ($requisite['value'] == 'true') {
            $cumple = "CUMPLE";
          } else {
            $cumple = "NO CUMPLE";
          }
          $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $cumple . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
        }
        if ($requisite['HTMLtype'] == 'YES / NO') {
          $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $requisite['value'] . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
        }
        if ($requisite['HTMLtype'] == 'NUMBER') {
          $pageContent .= '<tr><th style="border: 1px solid black; font-size: 14px;">' . $requisite['requisite_id'] . '</th><td style="border: 1px solid black; font-size: 14px;">'. $requisite['requisite_name'] .'</td><td style="border: 1px solid black; font-size: 14px; text-align:center;">' . $requisite['value'] . '</td><td style="border: 1px solid black;">&nbsp;&nbsp;&nbsp;&nbsp;</td></tr>';
        }
      }
      $pageContent .= '</table>';
      $toReturn .= '<pagina><div style="width:100%; height:200px;"></div><div style="width:100%; margin-left: 150px; margin-right:100px;">';
      $toReturn .= $pageContent;
      $toReturn .= '</div></pagina>';
    }
    return $toReturn;
  }

